import numpy as np

a = np.array([[17, 5, 13, 21, 9]])
b = np.array([[23, 6, 19, 2, 15]])
c = np.array([[4, 12, 25, 8, 16]])
d = np.array([[11, 24, 7, 20, 3]])
e = np.array([[10, 18, 1, 14, 22]])

magic = np.concatenate((d, c, a, e, b), axis = 0)

print(magic)

print("La dimensión es", magic.ndim)

print("La shape es", magic.shape)

print("La suma de sus filas es", np.sum(magic, axis = 1))
print("Lo podemos ver con la suma acumulada:\n", np.cumsum(magic, axis = 1))

print("La suma de sus columnas es\n", np.sum(magic, axis = 0))
print("Lo podemos ver con la suma acumulada:\n", np.cumsum(magic, axis = 0))

def sum_diags(x):
  """
  Esta función calcula la suma de los elementos de la diagonal principal (sum_main_diag)
    y la suma de los elementos de la diagonal secundaria (sum_secondary_diag)

  x: array de shape (n, n)
  """

  n = x.shape[0]
  sum_main_diag = 0
  sum_secondary_diag = 0

  for i in range(n):
    sum_main_diag += x[i, i]
    sum_secondary_diag += x[i, (n - 1) - i]

  return (sum_main_diag, sum_secondary_diag)

main_diag, secondary_diag = sum_diags(magic)

print("La suma de su diagonal principal es", main_diag)
print("La suma de su diagonal secundaria es", secondary_diag)

n = magic.shape[0] * magic.shape[1]
print("El número total de elementos del array es n =", n)

mean = np.sum(magic) / n
print("La media de los elementos del array magic es", mean, end = "\n\n")

for idx, i in np.ndenumerate(magic):
  print("El elemento con índice", idx, " vale ", i, end = " ")
  print("es mayor a la media" if i > mean else "es menor o igual a la media")

magic_greater_mean = magic[magic > mean]
print("Los elementos con valor mayor a la media son:\n", magic_greater_mean)

